graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_DataProcessing {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>DataProcessing</b> <i>&lt;namespace&gt;</i></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    direction="column";
    grid="3";
    "DataProcessing__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>a</b> <i>&lt;task&gt;</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
    "b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>b</b> <i>&lt;task&gt;</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
    "c" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>c</b> <i>&lt;task&gt;</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

    // Grid layout for cluster DataProcessing
    "cluster_DataProcessing__grid_rail_1" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];
    "cluster_DataProcessing__grid_rail_2" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];
    "cluster_DataProcessing__grid_rail_3" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];
    "cluster_DataProcessing__grid_rail_1" -> "cluster_DataProcessing__grid_rail_2" [style=invis];
    "cluster_DataProcessing__grid_rail_2" -> "cluster_DataProcessing__grid_rail_3" [style=invis];
    // Grid position 1
    { rank=same; "cluster_DataProcessing__grid_rail_1"; "a"; }
    // Grid position 2
    { rank=same; "cluster_DataProcessing__grid_rail_2"; "b"; }
    // Grid position 3
    { rank=same; "cluster_DataProcessing__grid_rail_3"; "c"; }
  }
  subgraph cluster_OtherProcessing {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>OtherProcessing</b> <i>&lt;namespace&gt;</i></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    direction="row";
    grid="2";
    "OtherProcessing__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "x" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>x</b> <i>&lt;task&gt;</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];
    "y" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>y</b> <i>&lt;task&gt;</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

    // Grid layout for cluster OtherProcessing
    "cluster_OtherProcessing__grid_rail_1" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];
    "cluster_OtherProcessing__grid_rail_2" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];
    "cluster_OtherProcessing__grid_rail_1" -> "cluster_OtherProcessing__grid_rail_2" [style=invis];
    // Grid position 1
    { rank=same; "cluster_OtherProcessing__grid_rail_1"; "x"; }
    // Grid position 2
    { rank=same; "cluster_OtherProcessing__grid_rail_2"; "y"; }
  }

}
